webpackJsonp([0xbdaf14ecd5d1d000],{"./node_modules/json-loader/index.js!./.cache/json/user-experience-design-a-b-testing.json":function(e,t){e.exports={data:{markdownRemark:{html:"<h2>What is A B Testing?</h2>\n<p>A/B testing (sometimes called split testing) is comparing two versions of a web page or element to see which one performs better. You compare two web pages or elements by showing the two variants (let’s call them A and B) to similar visitors at the same time. The one that gives a better conversion rate, wins!</p>\n<p>Every website wants visitors converting from just visitors to something else(Convertions, sign ups, or just take action for something). The rate at which a website is able to do this is its “conversion rate”. Measuring the performance of a variation (A or B) means measuring the rate at which it converts visitors to goal achievers.</p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<p>For more information on A/B Testing please read\n<a href='https://vwo.com/ab-testing/' target='_blank'>The Complete Guide to A/B Testing</a>.</p>",fields:{slug:"/user-experience-design/a-b-testing/"},frontmatter:{title:"A B Testing"}}},pathContext:{slug:"/user-experience-design/a-b-testing/"}}}});
